import { useSelector } from "react-redux";
import {Link} from "react-router-dom"
// import { useEffect , useState } from "react";

export default function NavBar() {
  const myState = useSelector((state) => state.savingAPI);
  console.log(myState);
  return (
    <>
      <div style={{height: "5%",width: "94%",border: "2px solid black",display : "block",margin: "auto",marginTop : "1%",borderRadius: "10px",}}>
        <ul style={{ display: "flex" , justifyContent : "center" }}>
          <Link style={{ marginLeft: "0%", listStyle: "none" , textDecoration : "none" , color : "black" }} to="/">Home</Link>
          <Link style={{ marginLeft: "5%", listStyle: "none" , textDecoration : "none" , color : "black" }} to="/mensClothing">Men's Clothing</Link>
          <Link style={{ marginLeft: "5%", listStyle: "none" , textDecoration : "none" , color : "black" }} to="/womensClothing">Women's Clothing</Link>
          <Link style={{ marginLeft: "5%", listStyle: "none" , textDecoration : "none" , color : "black" }} to="/">Jeweleries</Link>
          <Link style={{ marginLeft: "5%", listStyle: "none" , textDecoration : "none" , color : "black" }} to="/">Electronics</Link>
        </ul>
      </div>
            <h1 style={{textAlign : "center"}}>Cart Items</h1>
      <div style={{height: "100%",width: "94%",display: "flex",flexWrap: "wrap",margin : "auto"}}>
        {
          myState.rj.map((d,i)=>{
            return(
              <div key={i} style={{marginLeft : "3%" , marginTop : "1%"}}>
                <img src={d.image} alt="noImage" style={{ height: "100px", width: "100px" }} />
                {
                  //  <p style={{textAlign : "center"}}>{0}</p> 
                }
              </div>
            )
          })
        }
      </div>
        <hr />
    </>
  );
}
